import React from 'react'
import Footer from './Footer'
import Registration2 from './Registration2'
import {
    BrowserRouter as Router,
    Routes,
    Route
  } from "react-router-dom";

const Page1 = () => {
  return (
    <div>
     <Router>
        <Routes>
        <Route exact path="/" element={<Registration2/>} />
     <Footer/>
      </Routes>
    </Router>   
    </div>
  )
}

export default Page1
